package esercizio0;

public class Rettangolo {
	private int base;
	private int altezza;

	public Rettangolo(int b, int a) {
		base = b;
		altezza = a;
	}

	public int getBase() {
		return base;
	}

	public int getAltezza() {
		return altezza;
	}
}

package esercizio1;

public class Light {

	private boolean lightOn = false;
	private boolean bottomIn = false;
	private boolean bottomOut = false;

	Light() {
	}

	public boolean onOff(boolean light, boolean in, boolean out) {

		this.bottomIn = in;
		this.bottomOut = out;

		if ((bottomIn || bottomOut) && !light) {
			lightOn = true;
			return true; // Luce accesa
		} else {
			lightOn = false;
			return false; // Luce spenta
		}
	}
}

package esercizio2;

public class Computer {

	boolean Compute(boolean x, boolean y, boolean z, int temp, int thresh) {
		boolean no_alarm;

		if (temp <= thresh) {
			no_alarm = true;
		} else {
			no_alarm = false;
		}

		if ((x && (y || z)) && no_alarm)
			return true;
		else
			return false;
	}
}

package esercizio3;

public class Balance {

	private int p;
	private int w;

	Balance() {
	}

	public boolean setBalanceValue(int x, int y) {
		this.p = x;
		this.w = y;

		if ((p < 4 && w <= 400) || (p == 0 && w <= 1000))
			return true;
		else {
			return false;
		}
	}

	public int getP() {
		return p;
	}

	public int getW() {
		return w;
	}
}

package esercizio4;

public class Magazzino {

	private int[] product = new int[5]; // Rappresenta i 5 prodotti, da 0 a 4

	public Magazzino() {
		for (int i = 0; i < 1; i++) {
			product[i] = 0;
		}
	}

	/**
	 * @param productIndex l'indice del prodotto al quale aggiungere addQuantity
	 * @param addQuantity  la quantità da aggiungere al prodotto productIndex
	 * @return true se l'inserimento è avvenuto, false altrimenti
	 */
	public boolean insert(int productIndex, int addQuantity) {
		if ((productIndex < 0 || productIndex > 4) || (addQuantity < 0 || addQuantity > 10)
				|| (product[productIndex] + addQuantity) > 100) {
			return false;
		} else {
			product[productIndex] += addQuantity;
			return true;
		}
	}

	/**
	 * @param productIndex l'indice del prodotto che voglio controllare
	 * @return false se l'indice non è corretto o il magazzino non è pieno, true
	 *         altrimenti
	 */
	public boolean isFull(int productIndex) {
		if (productIndex < 0 || productIndex > 4)
			return false;
		else
			return product[productIndex] == 100 ? true : false;
	}

	/**
	 * @return true se il magazzino è pieno, false altrimenti
	 */
	public boolean isFull() {
		int total = 0;
		for (int i = 0; i < 5; i++)
			total += product[i];
		return total == 500 ? true : false;
	}
}

package esercizio5;

public class RushHour {

	int griglia[][];

	public RushHour() {
		griglia = new int[6][6];

		// Questo sarebbe inutile perchè è inizilizzato a zero di default
		for (int i = 0; i <= 5; i++) {
			for (int j = 0; j <= 5; j++) {
				griglia[i][j] = 0;
			}
		}

		griglia[2][2] = 1; // Macchina rossa
		griglia[1][5] = 2;
		griglia[2][5] = 3;
		griglia[3][5] = 4;
		griglia[4][1] = 5;
		griglia[0][3] = 6;
	}

	/**
	 * Move car
	 *
	 * @param row la riga della macchina da spostare: può essere un numero qualsiasi
	 *            ma viene fatto il controllo che sia tra 0 e 5 compresi.
	 * @param col la colonna della macchina da spostare: può essere un numero
	 *            qualsiasi ma viene fatto il controllo che sia tra 0 e 5 compresi.
	 * @param dir la direzione: 1. verso l'alto; 2. verso destra; 3. verso il basso;
	 *            4. verso sinistra.
	 * @return true se la macchina è spostata.
	 */
	public boolean moveCar(int row, int col, int dir) {
		if (row < 0 || row > 5 || col < 0 || col > 5 || dir < 1 || dir > 4) {
			// In tal caso ho sbagliato gli indici oppure ho indicato una direzione
			// inesistente
			return false;
		}

		if (griglia[row][col] == 0) {
			// In tal caso ho selezionato una casella vuota, non devo spostare altre
			// macchine
			return false;
		} else {

			int nRow, nCol; // Nuove coordinate della macchina

			if (dir == 1) {
				// Verso l'alto
				if (row == 0)
					// Voglio andare verso l'alto, ma sono al bordo
					return false;
				nRow = row - 1;
				nCol = col;
			} else if (dir == 2) {
				// Verso destra
				if (col == 5)
					// Voglio andare verso destra, ma sono al bordo
					return false;
				nCol = col + 1;
				nRow = row;
			} else if (dir == 3) {
				// Verso il basso
				if (row == 5)
					// Voglio andare verso il basso, ma sono al bordo
					return false;
				nRow = row + 1;
				nCol = col;
			} else {
				assert (dir == 4);
				// Verso sinistra
				if (col == 0)
					// Voglio andare verso sinistra, ma sono al bordo
					return false;
				nCol = col - 1;
				nRow = row;
			}

			if (griglia[nRow][nCol] != 0) {
				// La cella di destinazione è già occupata, non posso spostare la macchinina
				return false;
			} else {
				// La cella di destinazione è libera, sposto la macchina
				griglia[nRow][nCol] = griglia[row][col];
				griglia[row][col] = 0;
				return true;
			}
		}
	}

	/**
	 * Red car at exit
	 *
	 * @return true se la macchina rossa è in uscita
	 */
	public boolean redCarAtExit() {
		if (griglia[2][5] == 1) {
			return true;
		}

		return false;
	}
}
